import React from 'react';
import { Link } from 'react-router-dom';
import Header from './components/Header';

const App = () => {
  return (
    <div>
      <h1 className="route-title">Home</h1>
      <div className="Header">
        <Header />
      </div>
    </div>
  );
};

export default App;
